# 存放第一个参数是I的模版

- (I)Ljava/lang/String;:
    pattern:
      - const\/?\d*? (.*?), -?0x[a-f\d]+\s*(?:.line \d+)?\s*
      - invoke-static(?:\/range|) \{(?P<argument_names>.*?)\}, (?P<class_name>.*?)->(?P<method_name>.*?)
      - \(I\)Ljava/lang/String;\s*
      - move-result-object (?P<return_name>.*?)\s

